import * as React from 'react';
import { Image, View } from 'react-native';

const Logo = ({ style }) => {
    return <View style={{ width: "100%", height: "100%", ...style }}>
        <Image style={{ width: "100%", height: "100%" }} source={require('./img/time_manager_icon.png')} />
    </View>
}

export default Logo
